(() => {
    const BASE_URL = "http://localhost:8080";
    const checkUserUrl = "/api/public/user/exists?externalId=";
    const subscribeUrl = "/api/public/user/subscribe?email=";
    window.cbsWidget = {};
    const checkUser = (externalId, resolve, reject) => {
        fetch(`${BASE_URL}${checkUserUrl}${externalId}`)
            .then(res => {
                if(res.ok) {
                    res.json().then(response => {

                        if (!response) resolve && resolve(
                            createWidget((email, headerDiv) => {
                                fetch(`${BASE_URL}${subscribeUrl}${email}`, {
                                    method: 'POST',
                                    headers: {
                                        'Content-Type': 'application/json',
                                    },
                                    body: JSON.stringify({})
                                }).then(res => {
                                    if(res.ok) {
                                        res.json().then(response => {
                                            console.log(response);
                                            if (response) {
                                                addAlertToHeader(headerDiv, "Subscription Successful")
                                                setTimeout(() => {
                                                    const w = document.getElementsByTagName('app-widget')[0];
                                                    const body = document.getElementsByTagName('body')[0];
                                                    body.removeChild(w);
                                                }, 5000);
                                            }
                                            else {
                                                addAlertToHeader(headerDiv,
                                                    "Subscription failed Please try again.", true);
                                            }
                                        })} else {
                                        addAlertToHeader(headerDiv,
                                            "Subscription failed Please try again.", true);
                                    }
                                });
                            })
                        );
                        else reject && reject("cannot create widget, cause: User already subscribed!")
                    })
                } else {
                    res.json().then(error => {
                        console.log(error);
                        reject && reject(`cannot create widget with cause: ${error.error} ${error.message}`);
                    });
                }
            }, error => reject("cannot create widget, cause: " + error))
    }
    const createWidget = (callback) => {
        window.appWidget = document.createElement('app-widget');
        const widgetId = "cbsWidget-" + Math.round(Math.random() * 1000);
        let div = document.createElement('div');
        div.setAttribute("id", widgetId);
        let acceptBtnText = "Ok";
        let rejectBtnText = "Cancel";
        let message = "CBS Widget";
        const confirmBackdrop = "position: fixed;\n" +
            "  bottom: 20px;\n" +
            "  right: 5px;\n" +
            "  z-index: 1040;\n" +
            "  width: 220px;\n" +
            "  height: auto;\n" +
            "  background-color: #FFF;" +
            "box-shadow: 0 1rem 3rem rgba(111, 255, 79, 0.5);";
        div.setAttribute('style', confirmBackdrop);
        let headerDiv = document.createElement('div'); // header
        let imgDiv = document.createElement('div'); // profile bg

        const imgBg = "data:image/vnd.microsoft.icon;base64,";
        imgDiv.setAttribute('style',
            "height: 100px;" +
            "background-image: url(" + imgBg + "); " +
            "background-repeat: no-repeat;" +
            " background-position: center;" +
            "background-color: #8A2BE2;"
        )
        headerDiv.appendChild(imgDiv);
        let divChild1 = document.createElement('div');
        let divChild01 = document.createElement('div');
        let divChild010 = document.createElement('div');
        let divChild011 = document.createElement('div');
        let divChild0 = document.createElement('div');
        let divChild00 = document.createElement('div');
        let dataForm = document.createElement("form");
        dataForm.name = "data-form" + widgetId;
        dataForm.id = "data-form" + widgetId;
        let dataInput = document.createElement("input");
        dataInput.type = "email";
        dataInput.required = true;
        dataInput.placeholder = "Input email here";
        dataInput.setAttribute("style",
            "margin-bottom: 20px; " +
            "border: none; " +
            "border-bottom: orangered solid 1px;" +
            "border-radius: 0 !important;")

        let mCAuto = "margin: 0 auto !important; justify-content: center; display: flex;";
        // let mCAuto = "padding: 10px; justify-content: center;";

        divChild011.setAttribute('style', mCAuto);
        let confirmContent = "position: relative;\n" +
            "background-color: white;" + "width: auto; height: auto;" + "padding: 15px;" +
            "  margin: 50px auto !important;\n";
        if (window.innerWidth < 768) {
            confirmContent = "position: relative;\n" +
                "background-color: white;" + "width: auto; height: auto;" + "padding: 15px;" +
                "  margin: 50px auto !important;\n";
        }
        divChild010.setAttribute('style', confirmContent);
        let divChild2 = document.createElement('div');
        const center = "align-items: center;\n" +
            "font-size: 16px;" +
            "    justify-content: center;";
        divChild2.setAttribute("style", center);
        let para = document.createElement('p');
        para.innerText = message;
        divChild2.appendChild(para);
        let okButton = document.createElement('button');
        const successBtn = "background-color: #28a745;\n" +
            "  border-radius: 0;\n" + "border-style: none;" +
            "padding: 10px; margin-right: 10px;" +
            "cursor: pointer;" +
            "  float: left;" + "color: white;";
        const dangerBtn = "background-color: red;\n" +
            "  border-radius: 0;\n" + "border-style: none;" +
            "padding: 10px;" + "cursor: pointer;" +
            "  float: right;" + "color: white;";
        okButton.setAttribute('type', 'button');
        okButton.setAttribute('style', successBtn);
        okButton.innerText = acceptBtnText;
        okButton.addEventListener("click", () => {
            const value = dataInput.value;
            callback && callback(value, headerDiv);
            // observer.next(true);
            //appWidget.removeChild(document.getElementById(widgetId));
        });
        let cancelButton = document.createElement('button');
        cancelButton.setAttribute('type', 'button');
        cancelButton.setAttribute('style', dangerBtn);
        cancelButton.innerText = rejectBtnText;
        cancelButton.addEventListener("click", () => {
            console.log("cancel clicked");
            dataInput.value = '';
            // observer.next(false);
            // appWidget.removeChild(document.getElementById(widgetId));
        });
        const breakEl = document.createElement("br");
        divChild2.appendChild(dataInput);
        divChild2.appendChild(breakEl);
        divChild2.appendChild(okButton);
        divChild2.appendChild(cancelButton);

        dataForm.appendChild(divChild2);
        divChild1.appendChild(dataForm);
        divChild01.appendChild(divChild1);
        divChild010.appendChild(divChild01);
        divChild011.appendChild(divChild010);
        divChild0.appendChild(divChild011);
        divChild00.appendChild(headerDiv);
        divChild00.appendChild(divChild0);

        div.appendChild(divChild00);
        appWidget.appendChild(div);
        return appWidget;
    }
    const addAlertToHeader = (headerDiv, alertMessage, isError = false) => {
        let alertDiv = document.createElement('div');
        alertDiv.setAttribute('style',
            `position: absolute;
            z-index: 1100;
            bottom: 0;
            right: 0;
            width: 80%;
            text-align: center;
            padding: 0.75rem 1.25rem;
            margin-bottom: 1rem;
            border: 1px solid transparent;
            color: ${isError ? '#F00' : '#0F0'};
            background-color: rgba(163, 165, 162, 0.5);
            display: block;
            `);
        setTimeout(() => alertDiv.setAttribute('style',
            'display: none;' +
            'transition: display 1s linear;'), 3000);
        alertDiv.innerText = alertMessage;
        headerDiv.appendChild(alertDiv);
    };
    cbsWidget.gen = (externalId = "") => {
        return new Promise((resolve, reject) => {
            // check user
            checkUser(externalId, resolve, reject);
        })

    }
})()
